import './App.css';
import LoginSignup from './components/LoginSignup/LoginSignup';
import {RouterProvider, createBrowserRouter} from "react-router-dom";


const router = createBrowserRouter([
  {
    path: '/Login',
    element: <div></div>
  },
  {
    path: '/Home',
    element: <div></div>
  },
  {
    path: '/messages',
    element: <div></div>
  }
])

function App() {
  return <RouterProvider router={router}/>
}

export default App;
